import { Component } from '@angular/core';
import { Brand } from '../brand';
import { BrandService } from '../services/brand/brand.service';

@Component({
  selector: 'app-backend-requests',
  templateUrl: './backend-requests.component.html',
  styleUrls: ['./backend-requests.component.css']
})
export class BackendRequestsComponent {

  constructor(private heroService: BrandService) { }

  getBrands(){
    return this.heroService.getBrands();
  }
}


